import { Tabs,Tab, Toolbar,  } from '@mui/material';
import AppBar from '@mui/material/AppBar';
 
export const Navbar=()=>{

    const pages=['HOME','ABOUT','SERVICES','CONTACT']


    return(
        <>
        <AppBar>
            <Toolbar disableGutters>
               <Tabs>
                   <Tab label='Home'/>
               </Tabs>
            </Toolbar>
          
        </AppBar>
        </>
    )
}
